import React, {useMemo} from 'react'
import MaterialTable from 'material-table'
import MOCK_DATA from './MOCK_DATA.json'
import { COLUMNS } from './columns'

export const ImportTable = () => {
   
       
    return (
       <div>
            <MaterialTable 
            title={"Table"}
            data={MOCK_DATA}    
            columns={COLUMNS}
            />
        </div>
    )
}
